window.bookSummaryJSON = "<p>From <i>New York Times</i>/<i>USA Today</i> best-selling author Deanna Chase, the fifth book in the Jade Calhoun series.</p> <p>Starting a new job is tough...especially when your boss thinks nothing of interrupting your wedding.</p> <p>After a year of battling ghosts and demons, white witch Jade Calhoun is finally marrying the man of her dreams. Or is she? Minutes before Jade and Kane say I do, the High Angel arrives with a job for the newly appointed shadow walkers. Another witch’s life is on the line, and it’s up to Jade and Kane to save her.</p> <p>With a black magic user intent on destroying one of Jade’s friends, more demons on the loose, and a hard to find incubus, can the almost newlyweds save the witch and get their own happy ending?</p>"; 
